function generate() {
  var doc = new jsPDF("l", "pt", "letter");
  var htmlstring = "";
  var tempVarToCheckPageHeight = 0;
  var pageHeight = 0;
  pageHeight = doc.internal.pageSize.height;
  specialElementHandlers = {
    // element with id of "bypass" - jQuery style selector
    "#bypassme": function (element, renderer) {
      // true = "handled elsewhere, bypass text extraction"
      return true;
    },
  };
  margins = {
    top: 150,
    bottom: 60,
    left: 40,
    right: 40,
    width: 600,
  };
  var imgData =
    "data:image/png;base64,";

  doc.addImage(imgData, "JPEG", 15, 10, 100, 100);
  var y = 20;
  doc.setLineWidth(10);
  doc.text(340, (y = y + 50), "GMC Payroll");
  doc.autoTable({
    html: "#extra2",
    orientation: "landscape",
    pageSize: "A4",
    startY: 100,
    theme: "grid",
    columns: [2, 3, 4, 5, 6, 7, 8, 9],
    columnStyles: {
      4: {
        cellWidth: 100,
      },
      5: {
        cellWidth: 100,
      },
      6: {
        cellWidth: 100,
      },
      7: {
        cellWidth: 100,
      },
      8: {
        cellWidth: 100,
      },
      9: {
        cellWidth: 100,
      },
    },
    styles: {
      minCellHeight: 40,
    },
  });
  doc.save("GMCpayroll.pdf");
}
